/*ICONS*/

@font-face {
  font-family: 'fontello';
  src: url('sfsites/c/resource/LP_IconFont/font/fontello.eot?53365552');
  src: url('sfsites/c/resource/LP_IconFont/font/fontello.eot?53365552#iefix') format('embedded-opentype'),
       url('sfsites/c/resource/LP_IconFont/font/fontello.woff2?53365552') format('woff2'),
       url('sfsites/c/resource/LP_IconFont/font/fontello.woff?53365552') format('woff'),
       url('sfsites/c/resource/LP_IconFont/font/fontello.ttf?53365552') format('truetype'),
       url('sfsites/c/resource/LP_IconFont/font/fontello.svg?53365552#fontello') format('svg');
  font-weight: normal;
  font-style: normal;
}
/* Chrome hack: SVG is rendered more smooth in Windozze. 100% magic, uncomment if you need it. */
/* Note, that will break hinting! In other OS-es font will be not as sharp as it could be */
